import React from "react";
import "./style.scss";

function ToDoList() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          To<span>Do</span> List
        </h1>
        <p>Let's get things done</p>
      </header>
    </div>
  );
}

export default ToDoList;
